using ECommerce.Data;
using ECommerce.Models.Entities;
using System;
using Microsoft.EntityFrameworkCore;

namespace ECommerce.Data
{
    public class UnitOfWork : IDisposable
    {
        private ItemContext _db;
        public IGenericRepository<Item> Items { get; private set; }



        public UnitOfWork()
        {
            var options = new DbContextOptionsBuilder<ItemContext>()            
            .UseInMemoryDatabase(databaseName: "Test")
            .Options;

            _db = new ItemContext(options);

            Items = new GenericRepository<Item>(_db, _db.Items);


            Item item1 = new Item() { Name = "Удобрение 1", LongDescription = "Длинное описание", ShortDescription = "Короткое описание", Cost = 15, Picture= "data:image/jpeg;base64," };
            Item item2 = new Item() { Name = "Удобрение 1", LongDescription = "Длинное описание", ShortDescription = "", Cost = 15, Picture = "data:image/jpeg;base64," };

            Items.Create(item1);
            Items.Create(item2);
            Save();
        }

        public void Save()
        {
            _db.SaveChanges();
        }
        public async void SaveAsync()
        {
            await _db.SaveChangesAsync();
        }

        private bool disposed = false;

        public virtual void Dispose(bool disposing)
        {
            if (!this.disposed)
            {
                if (disposing)
                {
                    _db.Dispose();
                }
                this.disposed = true;
            }
        }

        public void Dispose()
        {
            Dispose(true);
            GC.SuppressFinalize(this);
        }
    }
}
